    background-color: #424242;
    position: relative;
    width: 20%;
    height: 100%;
    float: left;
`;

export const LeftPanelMenuStyle = styled.menu`
    text-align: left;
    background-color: #f5f5f5;
    position: relative;
    width: 100%;
    height: 100%;
    float: left;
`;

interface Props {}

interface State {}

class LeftPanel extends Component<Props, State> {
    state = {
        isActive: true,
    };

    render() {
        return <LeftPanelStyle>Menu</LeftPanelStyle>;
    }
}

export default LeftPanel;
